"""
Given a string S and a string T, find the minimum window in S which will contain all the characters in T in complexity O(n).

Example:

Input: S = "ADOBECODEBANC", T = "ABC"
Output: "BANC"

Note:
	If there is no such window in S that covers all characters in T, return the empty string "".
	If there is such window, you are guaranteed that there will always be only one unique minimum window in S.


"""
from collections import Counter
class Solution:
    def minWindow(self, s: str, t: str) -> str:
        tc = Counter(t)
        sc = Counter(s)
        for k in [kk for kk in sc.keys() if kk not in tc]:
            del sc[k]

        if any( 1 for k in tc.keys() if tc[k] > sc[k]):
            return ""

        t_ch = [s[idx] for idx in range(len(s)) if s[idx] in tc]
        t_loc = [idx for idx in range(len(s)) if s[idx] in tc]
        t_loc_l = t_loc_r = 0
        t_minbound = [0,len(t_loc)-1]
        bound2len = lambda b : t_loc[b[1]] - t_loc[b[0]] + 1
        
        tmpMap = {}
        for k in tc.keys():
            tmpMap[k] = 1 if t_ch[t_loc_l] == k else 0

        def tmpMapValid():
            return all( k in tmpMap and tmpMap[k] >= tc[k] for k in tc.keys())

        while t_loc_l <= len(t_ch) - len(t):
            while not tmpMapValid() and t_loc_r + 1 < len(t_ch):
                t_loc_r += 1
                tmpMap[ t_ch[t_loc_r] ] += 1

            if tmpMapValid() and bound2len([t_loc_l,t_loc_r]) < bound2len(t_minbound):
                t_minbound = [t_loc_l,t_loc_r]
            else:
                #t_loc_r = min(t_loc_r , len(t_ch) - 1)
                while t_loc_r > max(t_loc_l,t_minbound[1]):
                    tmpMap[t_ch[t_loc_r]] -= 1
                    t_loc_r -= 1
            tmpMap[t_ch[t_loc_l]] -= 1
            t_loc_l += 1
            
        return s[t_loc[t_minbound[0]]:t_loc[t_minbound[1]] + 1]


if __name__ == '__main__':
    #assert Solution().minWindow("","") == "a"
    assert Solution().minWindow("ab","a") == "a"
    assert Solution().minWindow("JJDDDADOBECODEBANC","ABC") == "BANC"
    assert Solution().minWindow("a","a") == "a"
    assert Solution().minWindow("a","aa") == ""
    assert Solution().minWindow("","") == ""
    assert Solution().minWindow("","ozgzyywxvtublcl") == "tcnvhxqgndyozpcigzykbiaucyvwrjvknifufxducbkbsmlanl"
    assert Solution().minWindow("cgklivwehljxrdzpfdqsapogwvjtvbzahjnsejwnuhmomlfsrvmrnczjzjevkdvroiluthhpqtffhlzyglrvorgnalk","mqfff") == "fsrvmrnczjzjevkdvroiluthhpqtff"
    

